import React, { Component } from 'react';
import './Header.scss';
class Header extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listMenu: [
        {
          title: 'Home'
        },
        {
          title: 'Manga'
        },
        {
          title: 'Blog'
        },
        {
          title: 'About Us'
        },{
          title: 'Shop'
        }
      ] 
    };
  }
  render() {
    return (
      <div id="header" className="header">
        <div>
          <div>
            <img alt="logo" src={require('../../assets/images/logo-light.png')}/>
          </div>
          <div className="list-menu">
            <ul>
              <li>
                {listMenu.map((item, index) => <div key={index}>{item.title}</div>)}
              </li>
            </ul>
          </div>
        </div>
      </div>
    );
  }
}

export default Header;
